import React from "react";
import { ListItem, Image, Box, List } from "@chakra-ui/react";

export default function MovieList({ movies }) {
  return (
    <List>
      {movies.map((movie) => (
        <ListItem>{movie.title}</ListItem>
      ))}
    </List>
  );
}
